import { Route, Routes } from "react-router";
import React from 'react';
import { routes } from "./router/routes";

const AppRouter = () => {
    return (
        <Routes>
            {routes.map(route => {
                <Route
                    path={route.path}
                    component={route.component}
                    exact={route.exact}
                    key={route.path}
                />
            })}
        </Routes>
    )
}

export default AppRouter;
